import * as React from 'react';
import 'rsuite/dist/styles/rsuite-default.css';
import {FooterV} from './src';

const footerdata:any={
   containerBackgroundColor:"dimgrey",
   textColor:"#eee",
   borderColor:"grey",
   companyLink:"https://www.vlinder.io/",
   logoSrc:"https://i.ibb.co/k6wXVbg/IMG-20201014-WA0026.jpg",
   logoAlt:"vlinder.io",
   address:"vlinder Labs Pvt. Ltd. TERRACE FLOOR, 837, 11TH CROSS, 26th Main Rd, 1st Sector, HSR Layout, Bengaluru, Karnataka 560102",
   contactNumber:"+91 80437745",
   email:"info@vlinder.io",
   copyright:"copyright: 2020 vlinder inc. All rights reserved. powered by",
   companyName:"vlinder.io",
   socialicon:[{
       icon:"facebook-square",
       url:"https://www.facebook.com",
       color:" #3b5998",
       target:"_blank"
    },
    {
       icon:"linkedin-square",
       url:"https://in.linkedin.com/",
       color:"white",
       target:"_blank"
    },
    {
       icon:"twitter-square",
       url:"https://twitter.com/?lang=en",
       color:"#00acee",
       target:"_blank"
    },
    {
       icon:"pinterest-square",
       url:"https://in.pinterest.com/",
       color:"red",
       target:"_blank"
    }
]
}




const Footer=()=>{
  return(
  <FooterV
   containerBackgroundColor="black"
    textColor="#eee"
    borderColor="grey"
    companyLink="https=//www.vlinder.io/"
    logoSrc="https=//i.ibb.co/k6wXVbg/IMG-20201014-WA0026.jpg"
    logoAlt="vlinder.io"
    address="vlinder Labs Pvt. Ltd. TERRACE FLOOR, 837, 11TH CROSS, 26th Main Rd, 1st Sector, HSR Layout, Bengaluru, Karnataka 560102"
    copyright="copyright: 2020 vlinder inc. All rights reserved. powered by"
    companyName="vlinder.io"
    contactNumber="+91 80437745"
    email="info@vlinder.io"
  />
  );
};

export default Footer;
